import React, { Fragment } from 'react';

function Loaded(props) {
  return (
    <Fragment>
      <h2>{ props.name }, { props.text }</h2>
      <input placeholder={ props.state.placeholder } onChange={ (params) => this.handleChange(params) } />
      <button onClick={ props.onClick }></button>
    </Fragment>
  );
}

function NotLoaded(props) {
  return (
    <Fragment>
      <h2>Loading...</h2>
      <button onClick={ props.onClick }></button>
    </Fragment>
  );
}

export { Loaded, NotLoaded };
